import { useEffect, useState } from "react";
import axios from "axios";             // ðŸ‘ˆ Import axios
import BasicNav from "../../components/Navbar";

function Test() {
    const [users, setUsers] = useState([]);
    const [loadState, setLoadState] = useState(true);
    useEffect(() => {
        const fetchUsers = async () => {
            setLoadState(true);
            try {
                const response = await axios.get("http://localhost:8080/user");
                console.log('Fetched users:', response.data);  
                setUsers(response.data);                       
            } catch (error) {
                console.error("Error fetching users:", error);
            }finally{
                setLoadState(false);
            }
        };

        fetchUsers();
    }, []);

    return (
        <Container className="mt-5">
            <BasicNav />
            <h1 className="text-center mb-5">Welcome to Test Area!</h1>

            {loadState === false ? (
                <Row>
                    {users.map(user => (
                        <Col key={user.id} md={4} className="mb-4">
                            <Card className="shadow-sm">
                                <Card.Body>
                                    <Card.Title>{user.firstName} {user.lastName}</Card.Title>
                                    <Card.Text><strong>Email:</strong> {user.email}</Card.Text>
                                    <Card.Text><strong>Username:</strong> {user.username}</Card.Text>
                                    <Card.Text><strong>Role:</strong> {user.role}</Card.Text>
                                    <Button variant="primary">View Profile</Button>
                                </Card.Body>
                            </Card>
                        </Col>
                    ))}
                </Row>
            ) : (
                <div className="text-center">
                    <Spinner animation="border" variant="primary" />
                    <p>Loading users...</p>
                </div>
            )}
        </Container>
    );

}

export default Test;
